import React from 'react';
import './App.scss';


import Header from './Header';
import Order from './Order';
import Inventory from './Inventory';

class App extends React.Component {
  render() {
    return (
      <div className="catch-of-the-day">
      <div className="menu">
        <Header tagline="I am training" />
      </div>
      <Inventory />
      <Order  />
      </div>
    )
  }
}

export default App;
